import React from 'react'

const NavBar = () => {

    return (
      <nav className="nav" id="navbar">
        <div className="nav-content">
          <img
            src={logo}
            className="nav-logo"
            alt="Logo"
            // onClick={}
          />
          <ul className="nav-items">
            <li className="nav-item">
                Section 1
            </li>
            <li className="nav-item">
                Section 2
            </li>
            <li className="nav-item">
                Section 3
            </li>
            <li className="nav-item">

                Section 4
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="section5"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Section 5
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    );
}

export default NavBar;
